import ReactDOM from 'react-dom'
/**
 * 组件
 *    1.函数式组件
 *      函数式组件就是返回JSX的普通函数
 *      组件的首字母必须大写
 *    2.类组件
 */

function App() {
  return (
    <div className="app">
      <h1>hello world</h1>
    </div>
  )
}

const root = ReactDOM.createRoot(document.getElementById('root'))
root.render(<App />)
